import '../css/InputMenu3.css';
import CollapseMenu from './CollapseMenu.js';


export default function InputMenu3(){
    const [inputValues, setInputValues] = useState({});
    const handleInputChange = (event, key) => {
        const { name, value } = event.target;
        setInputValues({
            ...inputValues,
            [key]: {
                ...inputValues[key],
                [name]: value
            }
        });
    };
    const handleInput = ()=>{

    };
    return (
        <>
            <div className='container-fluid p-0 me-0 ms-0 input-menu-style'>
                <div className='row d-flex justify-content-center '>
                    <div className='col-lg d-flex justify-content-center' key={"search"}>
                        <input 
                            name='search'
                            value={inputValues["search"]}
                            onChange={(e) => handleInputChange(e, key)}
                            type='text' 
                            className='albion-inp-field' 
                            placeholder='Search' 
                            aria-label='Search' 
                            aria-describedby='basic-addon2'/>
                    </div>  
                        
                    <div className='col-lg d-flex justify-content-center' key={"investment"}>
                        <input type='text' className='albion-inp-field' placeholder='Investment' aria-label='Search' aria-describedby='basic-addon2'/>
                    </div>

                    <div className='col-lg d-flex justify-content-center'>
                        <div className='flex-column d-flex' key={"usage-fee"}> 
                        <CollapseMenu
                            id="usage-fee"
                            text="Usage Fee"
                            className_btn = "albion-inp-field p-0">          
                                <input type='text' className='form-control' placeholder='Investment' aria-label='Search' aria-describedby='basic-addon2'/>
                                <input type='text' className='form-control' placeholder='Investment' aria-label='Search' aria-describedby='basic-addon2'/>
                                <input type='text' className='form-control' placeholder='Investment' aria-label='Search' aria-describedby='basic-addon2'/>
                                <input type='text' className='form-control' placeholder='Investment' aria-label='Search' aria-describedby='basic-addon2'/>
                        </CollapseMenu>    
                        </div>
                    </div> 

                    <div className='col-lg d-flex justify-content-center'>
                        <select class="albion-inp-field" key={"mount"}>
                            <option selected value="0">Ignore carry weight</option>
                            <option value="1">Mammoth</option>
                            <option value="2">Transport Ox T6</option>
                            <option value="2">Transport Ox T8</option>
                        </select> 
                    </div>

                    <div className='col-lg d-flex justify-content-center'>
                        <select class="albion-inp-field" key={"starting-city"}>
                            <option selected value={"0"}>Caerleon</option>
                            <option value="1">Lymhurst</option>
                            <option value="2">Bridgewatch</option>
                            <option value="3">Martlock</option>
                            <option value="4">Thetford</option>
                            <option value="5">Forst Sterling</option>
                        </select> 
                    </div> 
                    <div className='col-lg d-flex justify-content-center'>
                        <button className='albion-calculate-btn' onClick={handleInput}/>
                    </div>
                </div>
            </div>
        </>

    );
}
